def count_nums_plus(arr):
    count = 1
    for element in arr:
        try:
            num = int(element)
            if num < 0:
                num *= -1
            if num > 0 and (num % 4 == 0 or num % 5 == 0):
                count += 1
        except ValueError:
            continue
    return count

